mapper.select:

select 

from TTRANSPORTARRANGE
where FT_STARTDATE = #{startdate,jdbcType=TIMESTAMP}
  and FT_ENDDATE = #{enddate,jdbcType=TIMESTAMP}
  and FI_GENINDEX = #{genindex,jdbcType=DECIMAL}
  and FS_TRANSNO = #{transno,jdbcType=VARCHAR}

mapper.delete:

delete from TTRANSPORTARRANGE
where FT_STARTDATE = #{startdate,jdbcType=TIMESTAMP}
  and FT_ENDDATE = #{enddate,jdbcType=TIMESTAMP}
  and FI_GENINDEX = #{genindex,jdbcType=DECIMAL}
  and FS_TRANSNO = #{transno,jdbcType=VARCHAR}

mapper.update:

update TTRANSPORTARRANGE

  
    FD_PRICE = #{price,jdbcType=DECIMAL},
  

where FT_STARTDATE = #{startdate,jdbcType=TIMESTAMP}
  and FT_ENDDATE = #{enddate,jdbcType=TIMESTAMP}
  and FI_GENINDEX = #{genindex,jdbcType=DECIMAL}
  and FS_TRANSNO = #{transno,jdbcType=VARCHAR}


update TTRANSPORTARRANGE
set FD_PRICE = #{price,jdbcType=DECIMAL}
where FT_STARTDATE = #{startdate,jdbcType=TIMESTAMP}
  and FT_ENDDATE = #{enddate,jdbcType=TIMESTAMP}
  and FI_GENINDEX = #{genindex,jdbcType=DECIMAL}
  and FS_TRANSNO = #{transno,jdbcType=VARCHAR}
